import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col, Figure, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import './vehicle_card.css'
import Vehicle_detail from './Vehicle_detail';

import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import ReactDOM from 'react-dom';




export default function Cour_dynamic(prop) {

    let veh = prop.name;
    let veh_name = veh.toUpperCase();

    return (<div className="col-sm-12 col-md-6 col-lg-4">

        <Card className="col-sm-12 col-md-12 col-lg-12 mt-3 " border="dark">
            <Card.Body>
            <div className="zoom">
            <Card.Img variant="top" src={process.env.PUBLIC_URL + prop.name}  style={{ height: '100px',width: '100%'}} className="zoom"/>
            </div>
                <Card.Title className="mt-3">{veh_name}</Card.Title>
                <Card.Text>


                </Card.Text>
                <Button variant="primary" className="btn btn-sm " id={veh} value="bigb" onClick={() => submit(veh)}>Detail</Button>
            </Card.Body>
        </Card>

    </div>)

}


